import React , { useEffect, useState }  from "react";
import axios from 'axios';


const Get = () => {
  const [city, setCity] = useState([]);

  const getCity = async () => {
    const response = await axios.get(`/predict/${city}`);
    response.json().then((res) => setCity(res.data.city));
    console.log(city);
  };

  useEffect(() => {
    getCity();
  },);

  return (
    <>
      {city.map((ce) => (
        <div>
          <h2>{ce}</h2>
        </div>
      ))}
    </>
  );
};

export default Get;
